import React, { PureComponent } from "react";
import {
  AreaChart,
  Area,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
} from "recharts";

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/c1rLyqj1/";

  render() {
    const { title, data, stroke1, stroke2, stroke3 } = this.props;
    return (
      <div>
        <h3 className="barTitle">{title}</h3>

        <AreaChart
          width={600}
          height={400}
          data={data}
          margin={{
            top: 50,
            right: 50,
            left: 80,
            bottom: 25,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis
            label={{
              value: "Sense Cycle Memory (%)",
              position: "bottom",
              offset: 0,
            }}
            dataKey="name"
          />
          <YAxis
            label={{
              value: "Neural Netowork Memory (%)",
              position: "top",
              offset: 20,
            }}
          />
          <Tooltip />
          <Area
            type="monotone"
            dataKey="sense"
            stackId="1"
            stroke="#8884d8"
            fill="#8884d8"
            label="Hello"
          />
          <Area
            type="monotone"
            dataKey="nn"
            stackId="2"
            stroke="#82ca9d"
            fill="#82ca9d"
          />
        </AreaChart>
        <div>
          <ul>
            <li>
              <span className="colorCode"></span>Neural Network
            </li>
            <li>
              <span className="colorCode"></span>Sense Cycle
            </li>
          </ul>
        </div>
      </div>
    );
  }
}
